import React, { useState, useEffect } from "react";
import axios from "axios";
import logo from "../../../Healistry.png";
import Form from "react-bootstrap/Form";
import Paper from "@material-ui/core/Paper";
import { makeStyles } from "@material-ui/core/styles";
import "bootstrap/dist/css/bootstrap.min.css";
import Col from "react-bootstrap/esm/Col";
import Row from "react-bootstrap/esm/Row";
import swal from "sweetalert";
import { useHistory } from "react-router-dom";


function Hospital_edit() {
  const [name, setName] = useState("");
  const [location, setLocation] = useState("");
  const [contact, setContact] = useState("");
  const [warddetails, setWarddetails] = useState("");
  const [staffcount, setStaffcount] = useState("");
  const [image, setImage] = useState("");

  const [postImage, setPostImage] = useState({ myFile: "" });


  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [hospital, setHospital] = useState([]);


  // let [errors_dname, seterrors_dname] = useState("");
  // let [errors_location, seterrors_location] = useState("");
  // let [errors_noe, seterrors_noe] = useState("");
  // let [errors_since, seterrors_since] = useState("");
  // let [errors_description, seterrors_description] = useState("");
  // let [errors_cnumber, seterrors_cnumber] = useState("");

  const id = window.sessionStorage.getItem("HospitalID");

  useEffect(() => {
    axios.get(`http://localhost:4000/hospital/${id}`).then((response) => {

      setName(response.data.name);
      setLocation(response.data.location);
      setContact(response.data.contact);
      setWarddetails(response.data.warddetails);
      setStaffcount(response.data.staffcount);

      setHospital(response.data);
      console.log(response.data);
    });
  }, []);

  const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
      margin: 50,
    },
    paper: {
      padding: theme.spacing(5),
      margin: "auto",
      maxWidth: 1000,
    },
  }));

  const classes = useStyles();
  const history = useHistory();

  function UpdateHospitalCompany() {
    // setError(null);
    // setLoading(true);

    // let errors = {};

    // //Form Validation
    // if (!name.trim()) {
    //   errors.name = "Company Name field required";
    //   seterrors_dname(errors.name);
    // }
    // if (!location.trim()) {
    //   errors.location = "Location field required";
    //   seterrors_location(errors.location);
    // }
    // if (!noe.trim()) {
    //   errors.noe = "Number of Employee field required";
    //   seterrors_noe(errors.noe);
    // }
    // if (!since.trim()) {
    //   errors.since = "Since field required";
    //   seterrors_since(errors.since);
    // }
    // if (!description.trim()) {
    //   errors.description = "Description field required";
    //   seterrors_description(errors.description);
    // }
    // if (!cnumber.trim()) {
    //   errors.cnumber = "Contact Number field required";
    //   seterrors_cnumber(errors.cnumber);
    // }

    // if (
    //   name === "" ||
    //   location === "" ||
    //   noe === "" ||
    //   since === "" ||
    //   description === ""
    // ) {
    //   setLoading(false);
    // } else {
    //   console.log({
    //     CName: name,
    //     Location: location,
    //     NOE: noe,
    //     CNumber: cnumber,
    //     Since: since,
    //     Image: postImage.myFile,
    //     Description: description,
    //   });
      axios
        .patch(`http://localhost:4000/hospital/${id}`, {
          name: name,
          location: location,
          contact: contact,
          warddetails: warddetails,
          staffcount: staffcount,
          image:image


        })
        .then((response) => {
          setLoading(false);
          swal(
            "Good job!",
            "Your data has been successfully Updated..!",
            "success"
          );
          // window.location.reload();
          history.push("/Hospital_update");
        })
        .catch((error) => {
          setLoading(false);
          alert("Sorry, Something Error...");
          swal("Sorry!", "Something Error..!", "warning");
        });
    }


  const convertToBase64 = (file) => {
    return new Promise((resolve, reject) => {
      const fileReader = new FileReader();
      fileReader.readAsDataURL(file);
      fileReader.onload = () => {
        resolve(fileReader.result);
      };
      fileReader.onerror = (error) => {
        reject(error);
      };
    });
  };

  const handleFileUpload = async (e) => {
    const file = e.target.files[0];
    const base64 = await convertToBase64(file);
    // setPostImage({ ...postImage, myFile: base64 });
    setPostImage({ myFile: base64 });
    // console.log(base64);
  };

  return (
    <div>
      <div className="app-container app-theme-white body-tabs-shadow fixed-sidebar fixed-header">
        <div className="app-header header-shadow">
          <div className="app-header__logo">
            Dashboard
            <div className="header__pane ml-auto">
              <div>
                <button
                  type="button"
                  className="hamburger close-sidebar-btn hamburger--elastic"
                  data-class="closed-sidebar"
                >
                  <span className="hamburger-box">
                    <span className="hamburger-inner" />
                  </span>
                </button>
              </div>
            </div>
          </div>
          <div className="app-header__mobile-menu">
            <div>
              <button
                type="button"
                className="hamburger hamburger--elastic mobile-toggle-nav"
              >
                <span className="hamburger-box">
                  <span className="hamburger-inner" />
                </span>
              </button>
            </div>
          </div>
          <div className="app-header__menu">
            <span>
              <button
                type="button"
                className="btn-icon btn-icon-only btn btn-primary btn-sm mobile-toggle-header-nav"
              >
                <span className="btn-icon-wrapper">
                  <i className="fa fa-ellipsis-v fa-w-6" />
                </span>
              </button>
            </span>
          </div>
          <div className="app-header__content">
            <div className="app-header-left">
              <div className="search-wrapper">
                <div className="input-holder">
                  <input
                    type="text"
                    className="search-input"
                    placeholder="Type to search"
                  />
                  <button className="search-icon">
                    <span />
                  </button>
                </div>
                <button className="close" />
              </div>
            </div>
            <div className="app-header-right">
              <div className="header-btn-lg pr-0">
                <div className="widget-content p-0">
                  <div className="widget-content-wrapper">
                    <div className="widget-content-left">
                      <div className="btn-group">
                        <a
                          data-toggle="dropdown"
                          aria-haspopup="true"
                          aria-expanded="false"
                          className="p-0 btn"
                        >
                          <i className="fa fa-angle-down ml-2 opacity-8" />
                        </a>
                        <div
                          tabIndex={-1}
                          role="menu"
                          aria-hidden="true"
                          className="dropdown-menu dropdown-menu-right"
                        >
                          <button
                            type="button"
                            tabIndex={0}
                            className="dropdown-item"
                          >
                            User Account
                          </button>
                          <button
                            type="button"
                            tabIndex={0}
                            className="dropdown-item"
                          >
                            Settings
                          </button>
                          <h6 tabIndex={-1} className="dropdown-header">
                            Header
                          </h6>
                          <button
                            type="button"
                            tabIndex={0}
                            className="dropdown-item"
                          >
                            Actions
                          </button>
                          <div tabIndex={-1} className="dropdown-divider" />
                          <button
                            type="button"
                            tabIndex={0}
                            className="dropdown-item"
                          >
                            Dividers
                          </button>
                        </div>
                      </div>
                    </div>
                    <div className="widget-content-left  ml-3 header-user-info">
                      <div className="widget-heading">Admin U.</div>
                      <div className="widget-subheading">
                        Full-Stack Developer
                      </div>
                    </div>
                    <div className="widget-content-right header-user-info ml-3">
                      <button
                        type="button"
                        className="btn-shadow p-1 btn btn-primary btn-sm show-toastr-example"
                      >
                        <i className="fa text-white fa-calendar pr-1 pl-1" />
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="app-main">
          <div className="app-sidebar sidebar-shadow">
            <div className="app-header__logo">
              <div className="logo-src" />
              <div className="header__pane ml-auto">
                <div>
                  <button
                    type="button"
                    className="hamburger close-sidebar-btn hamburger--elastic"
                    data-class="closed-sidebar"
                  >
                    <span className="hamburger-box">
                      <span className="hamburger-inner" />
                    </span>
                  </button>
                </div>
              </div>
            </div>
            <div className="app-header__mobile-menu">
              <div>
                <button
                  type="button"
                  className="hamburger hamburger--elastic mobile-toggle-nav"
                >
                  <span className="hamburger-box">
                    <span className="hamburger-inner" />
                  </span>
                </button>
              </div>
            </div>
            <div className="app-header__menu">
              <span>
                <button
                  type="button"
                  className="btn-icon btn-icon-only btn btn-primary btn-sm mobile-toggle-header-nav"
                >
                  <span className="btn-icon-wrapper">
                    <i className="fa fa-ellipsis-v fa-w-6" />
                  </span>
                </button>
              </span>
